import React from 'react';
var name;
const [number, setNumber] = useState(null);
const [expMonth, setExpMonth] = useState(null);
const [expYear, setExpYear] = useState(null);
const [cvc, setCVC] = useState(null);

const SetCardInfoName = (name) => {
    setName(name);
}

const SetCardInfoNumber = (number) => {
    setNumber(number);
}

const SetCardInfoMonth = (expMonth) => {
    setExpMonth(expMonth);
}

const SetCardInfoYear = (expYear) => {
    setExpYear(expYear);
}

const SetCardInfoCVC = (cvc) => {
    setCVC(cvc);
}


export default {
    SetCardInfoName, 
    SetCardInfoNumber, 
    SetCardInfoMonth, 
    SetCardInfoYear, 
    SetCardInfoCVC,
};
